import styled from "styled-components";
import Form from "../Components/Form/Form";
import FormInput from "../Components/Form/FormInput";
import { useTranslation } from "react-i18next";

const FormContainer = styled.div`
  padding-top: 50px;
`;

const Contact = () => {
  const { t } = useTranslation();

  const title = <h1>{t("Home.Contact.Title")}</h1>;

  const sendButtonText = <p>{t("Home.Contact.SendNow")}</p>;

  const successMessage = (
    <>
      <Text
        align="left"
        size="15px"
        color={(props) => props.theme.colors.black}
        marginTop="25px"
      >
        {t("Home.Contact.SuccessMessage1")}
      </Text>
      <Text
        align="left"
        size="15px"
        color={(props) => props.theme.colors.black}
        marginTop="10px"
      >
        {t("Home.Contact.SuccessMessage2")}
      </Text>
    </>
  );

  const errorMessage = (
    <>
      <Text
        align="left"
        size="15px"
        color={(props) => props.theme.colors.red}
        marginTop="25px"
      >
        {t("Home.Contact.ErrorMessage1")}
      </Text>
      <Text
        align="left"
        size="15px"
        color={(props) => props.theme.colors.red}
        marginTop="10px"
      >
        {t("Home.Contact.ErrorMessage2")}
      </Text>
    </>
  );

  return (
    <FormContainer>
      <Form
        title={title}
        sendButtonText={sendButtonText}
        successMessage={successMessage}
        errorMessage={errorMessage}
      >
        <FormInput
          placeholder={t("Home.Contact.Company")}
          type="text"
          name="name"
          marginTop="60px"
          marginBottom="20px"
          width="90%"
        />
        <FormInput
          placeholder={t("Home.Contact.ContactPerson")}
          type="text"
          name="contactPerson"
          marginBottom="20px"
          width="90%"
        />
        <FormInput
          placeholder={t("Home.Contact.EMail")}
          type="email"
          name="email"
          marginBottom="20px"
          width="90%"
        />
        <FormInput
          placeholder={t("Home.Contact.Message")}
          name="message"
          type="textarea"
          marginBottom="45px"
          width="90%"
          multiline
        />
      </Form>
    </FormContainer>
  );
};

export default Contact;
